import React, { Component, useEffect, useState } from "react";
import axios from "axios";


const Acidentes = () =>{

    const [data, setData] = useState([])

    const handleIncident = () =>{
        axios.get("https://dev.atmansystems.com/attlas-public/api/Incidents")
        .then((res) => {
            alert("ok");
            console.log(res.data);
            setData(res.data)
          })
          .catch((error) => {
            alert("deu erro");
            console.log(error.response);
          });
    }

    useEffect(()=>{
        handleIncident()
    })


    return(
        <div className="container">
            <p>Acidentes</p>
            <div className="box">
                <p>Controlador: </p>
                <p>ID: </p>
                <p>LAT: {data.latitude}</p>
                <p>LONG: </p>
                <p>MENSAGEM: </p>
            </div>
        </div>
    )
}

export default Acidentes;
